import React from 'react';
import Navbar from './Navbar';

const Home = () => {
  return (
    <div className="bg-gray-100">
      <header className="bg-blue-900 text-white py-6">
        <div className="container mx-auto px-4">
          <h1 className="text-4xl font-black">Flex</h1>
        </div>
      </header>
      <Navbar />
      <div className="container mx-auto px-4 py-16">
        <h1 className="text-5xl font-black mb-8">Welcome to Flex Fitness</h1>
        <p className="text-xl text-gray-800 leading-relaxed mb-8">
          Get fit and stay healthy with our workout and exercise tracking app.
        </p>
        <a
          href="#"
          className="bg-blue-900 text-white py-3 px-6 rounded-md font-bold hover:bg-blue-800 transition duration-300"
        >
          Get Started
        </a>
      </div>
    </div>
  );
};

export default Home;
